import React, { useState, useEffect, } from 'react';
import axios from 'axios'

function HomePage() {
  useEffect(async () => {
    axios.get(window.origin + '/api/test')
  }, [])
  return <div>Welcome to the front end!!</div>
}

export default HomePage
